import * as React from 'react';
import styles from './Calculator.module.css'

interface Props {
    streamingName: string;
}

interface State {
    count: number;
}

export class Calculator extends React.PureComponent<Props, State>{
    public render(): React.ReactNode {
        return(
            <div className={styles.container}>
                {this.props.streamingName}

                <div className={styles.underline}>
                    <input placeholder="30" className={styles.input} onChange={this.setTotal}/>
                </div>
            </div>
        );
    }
}
